import React, {Component} from "react"
import PrikazFilmova from "./PrikazFilmova"

class Filmovi extends Component{
    
    constructor(){
        super()
        this.state = {
            filmovi: []
        }
    }
    
    componentDidMount(){
        /*const config={
            method: 'GET',
            mode: 'cors',
            dataType: "",
            headers: { 
                'Access-Control-Request-Method' : 'POST',
                'Content-Type': 'application/json',
                'Origin': 'http://localhost:8080/bioskop/filmovi'
            }
          };*/

        var headers = new Headers();
        headers.append('Access-Control-Request-Method', 'GET');
        headers.append('Content-Type', 'application/json');
        headers.append('Origin','http://localhost:8080/bioskop/filmovi');
        
        fetch('http://localhost:8080/bioskop/filmovi',headers)
            .then(res => res.json())
            .then(response => {
                this.setState({
                    filmovi: response
            })
        })
    }

    render(){
        const prikaz=this.state.filmovi.map(f => <PrikazFilmova key={f.id} film={f} />)
        return(
            <div id="Filmovi">
                <table border="1">
                    <thead>
                        <tr>
                            <th>
                                Naziv
                            </th>
                            <th>
                                Zanr
                            </th>
                            <th>
                                Trajanje
                            </th>
                            <th>
                                Distributer
                            </th>
                            <th>
                                Zemlja porekla
                            </th>
                            <th>
                                Godina proizvodnje
                            </th>
                        </tr>
                    </thead>
                    {prikaz}
                </table>
                <br/>
            </div>
        )
    }

}

export default Filmovi
